INSERT INTO `agendamentos` VALUES ('575', '2018-05-14', '1', '13:00', '7', 'Claudia Terumi Akama', '460', '0', '', 'Possuo uma depressão já diagnosticada, fazia acompanhamento quando possuía plano de saúde. Infelizmente, por conta de dificuldade financeira enfrentada por minha família, tivemos que cancelar o plano. Faço, uso dos medicamentos Citalopran e Oxilato de EScitalopran. Estou necessitando muito de acompanhamento terapêutico.', '1', 'Vi uma placa informativa na Biblioteca', '08/05/2018', '1', '', 'ES457', '269', '0', '2018-05-16 08:51:21', null, null, null, null, null);
