INSERT INTO `agendamentos` VALUES ('985', '2018-07-20', '1', '09:00', '11', 'Alexandre da Matta', '573', '0', '', 'Estou procurando o atendimento por dificuldades no meu relacionamento, acho que estou vivendo um relacionamento abusivo e estou sofrendo muito com isso, quero um olhar profissional sobre minha situação, saber se o problema não está apenas na minha cabeça e resolver a minha situação, estes problemas têm interferido diretamente na minha vida acadêmica.', '1', 'Uma amiga fazia consulta', '13/07/2018', '1', '', 'ES833', '403', '0', '2018-07-20 13:29:49', null, null, null, null, null);
